data.text:
@igorcg @nowiht Porra um rapper se suicidou pq rolou uma pressão psicológica foda em cima do cara pq ele namorava uma mina trans.
Ai a arrombada vem me falar "Ah o rap é assim mesmo" Mano se fecha e lava a boca pra falar disso aqui.
A cena é cagada, tem MTA merda e mto a melhorar, mas se fecha
